import React from 'react';
import styled from "styled-components";

const title = styled.div`
  width: 200px;
  color: #ffffff;
  background-color: #34bfb2;
  
  text-align: center;
  box-sizing: border-box;
  display: inline-block;
`;

const Header = ({ title }) => (
  <div>
    <div>{title}</div>
  </div>
);

export default Header;
